import { Router } from 'express';
import bcrypt from 'bcrypt';
import jwt from 'jsonwebtoken';

import { SECRET_KEY } from '~/env';

import validate from './validate';
import { UserColl } from './model';

const controller = (() => {
  const router = Router();

  router.post('/register', validate, async (req, res) => {
    const { password, username } = req.body;

    try {
      const passwordHash = await bcrypt.hash(password, 10);
      const user = new UserColl({ username, password: passwordHash });
      await user.save();
      res.status(200).json({ username, message: 'Sign up suceesfully' });
    } catch (error) {
      res.status(400).json({ error });
    }
  });

  router.post('/login', validate, async (req, res) => {
    const { username, password } = req.body;

    try {
      const user = await UserColl.findOne({ username });
      if (!user) {
        res.status(400).json({ message: 'Incorrect username / Password' });
        return;
      }
      const passwordsMatch = await bcrypt.compare(password, user.password);

      if (passwordsMatch) {
        const payload = { _id: user._id, username: user.username };

        req.login(payload, { session: false }, async error => {
          if (error) res.status(400).json({ message: error });

          res.json({
            username: user.username,
            accessToken: jwt.sign(payload, SECRET_KEY, { expiresIn: '7d' }),
            message: 'Sign in suceesfully',
          });
        });
      } else {
        res.status(400).json({ message: 'Incorrect username / Password' });
      }
    } catch (error) {
      res.status(400).json({ message: error });
    }
  });

  return router;
})();

