const validator = require('validator');

export default function(req, res, next) {
  const { fullname, address_1, address_2, city, state, zipcode } = req.body;
  const errors = [];
  if (!fullname || !validator.isLength(fullname, { min: 5, max: 50 })) {
    errors.push('Fullname length is not valid');
  }
  if (!address_1 || !validator.isLength(address_1, { min: 1, max: 100 })) {
    errors.push('Address1 length is not valid');
  }
  if (address_2 && !validator.isLength(address_2, { min: 1, max: 100 })) {
    errors.push('Address2 length is not valid');
  }
  if (!city || !validator.isLength(city, { min: 1, max: 100 })) {
    errors.push('City length is not valid');
  }
  if (!state || !validator.isLength(state, { min: 2, max: 2 })) {
    errors.push('State length is not valid');
  }
  if (!zipcode || !validator.isLength(zipcode, { min: 5, max: 9 })) {
    errors.push('ZipCode length is not valid');
  }
  if (errors.length) res.status(400).json({ message: errors });
  else next();
}
